import React from 'react';
import { FaExchangeAlt } from 'react-icons/fa';
import { StyledSideBar, StyledLink } from './styles';

function SideBar() {
    return (
        <StyledSideBar>
            <nav>
                <ul>
                    <li>
                        <StyledLink to="/transactions">
                            Transactions <FaExchangeAlt />
                        </StyledLink>
                    </li>
                </ul>
            </nav>
        </StyledSideBar>
    );
}

export default SideBar;
